function AboutMe() {
    return (
      <div className="fiftyPix">
        <p>Third-year CS student at Lancaster University.</p>
        <h4>Skills:</h4>
        <p>Java, JavaScript, React.js, CSS, Teamworking, Ukrainian, Russian</p>
        <h4>Hobbies:</h4>
        <ul>
              <li>Volleyball</li>
              <li>Gym</li>
              <li>Milk</li>
        </ul>
        <p>, , , Travelling, Cars</p>
      </div>
    );
  }

  export default AboutMe;
